void solve(){
  ll n,x,a,o;
  cin>>n>>x>>a>>o;

    vector<ll> v(n);
    for(int i=0;i<n;i++){
        cin>>v[i];
    }
    ll len = -1;

    
    

    vector<ll> freqbits(64),freqbits2(64);
    ll XOR = 0,OR = 0,AND = v[0];
    ll l=0,r=0;
    for(;r<n;r++){
        for(int i=0;i<64;i++){
            if(v[r]&(1LL<<i)){
                freqbits[i]++;
            }else freqbits2[i]++;
        }
        XOR^=v[r];
        OR|=v[r];
        AND&=v[r];
        // cout<<l<<" "<<r<<nl;
        // cout<<XOR<<" "<<OR<<" "<<AND<<nl;

        while(l<r and (XOR>x or OR>o or AND>a)){
            for(int i=0;i<64;i++){
                if(v[l]&1LL<<i){
                    if(freqbits[i]&1){
                        XOR^=(1LL<<i);
                    }
                    if(freqbits[i]==1){
                        OR^=(1LL<<i);
                    }
                    freqbits[i]--;
                }else{
                    if(freqbits2[i]==1){
                        AND^=(1LL<<i);
                    }
                    freqbits2[i]--;
                }
            }
            l++;
        }
        // cout<<l<<" "<<r<<nl;
        // cout<<XOR<<" "<<OR<<" "<<AND<<nl;

        // find the xor , or , and of every pair in this range

    

        if(XOR<=x and OR<=o and AND<=a){
            // cout<<l<<' '<<r<<nl;
            // cout<<XOR<<" "<<OR<<" "<<AND<<nl;
            len = max(len,r-l+1);
        }

    }
    cout<<len<<nl;




}
 
