//function to search for a composition by name
function findCompByName (_name){ 
	//loop to search for a composition by a given name
	for (var i=1; i<=app.project.numItems; i++){	
		//check if the object name coincides with the given name and if the given object is a composition.
		if (app.project.item(i).name == _name && app.project.item(i) instanceof CompItem){	
			//return the composition name by its index
			return app.project.item(i); 
		}
	}
	return null;
}

//function to search for an effect by name in a layer
function findEffectByName (_name,_layer){ 
	//specify that it's an effect on a layer.
	var eff = _layer.property("ADBE Effect Parade"); 
	//loop from 1 to the number of effects on the layer
	for (var e=1; e<=eff.numProperties; e++){ 
		//if the effect name matches the given name - return the effect name by its index
		if (eff.property(e).name == _name) return eff.property(e); 
	}
	return null;
}

//folder creation function
function getFolder (_name){	
	//set a variable for the new folder
	var bFolder; 
	//set a loop to check for the presence of a folder with the given name
	for (var i=1; i<=app.project.numItems; i++){	
		//check if the name of the item matches the name of the specified folder and if this item is a folder
		if (app.project.item(i).name == _name && app.project.item(i) instanceof FolderItem){ 
			// if such folder already exists - assign its index to the variable bFolder
			bFolder = app.project.item(i); 
		}
	}
	// if the specified folder is not found - create it
	if (!bFolder) bFolder=app.project.items.addFolder(_name); 
	return bFolder;	
	//then 1 condition will apply, since the folder has already been created.
}	


function findImportFile (_name) {
	for (var f=1; f<=app.project.numItems; f++){
		if (app.project.item(f).name.substr(0, app.project.item(f).name.lastIndexOf(".")) == _name && app.project.item(f) instanceof FootageItem && app.project.item(f).parentFolder.name == inportFolder.name) {
			return app.project.item(f);
			}
	}
}

// a random number with no repeats!
var randNum;
var randNumOld;
function getRandomInt(min, max) {
    randNum = Math.floor(Math.random() * (max - min + 1)) + min;
    if(randNum==randNumOld) getRandomInt(1, 6);
    randNumOld = randNum;
    return randNum;
}


