		//if YES
		if (files[i].name.substr(-3) == "csv"){  
			//create an array for the data
			var textLines = [];	
			//open the file for reading
			files[i].open("r");	
			//cycle: until all lines of the file are finished
			while(!files[i].eof) {	
			//put all strings into the array	
			textLines.push(files[i].readln());	
			}
		} else {	//if the file is not CSV
			//create a variable for the imported file
			var importF;	
			//create a new file 
			var importOptions = new ImportOptions (files[i]);
			//assign the imported file to the variable 
			importF=app.project.importFile (importOptions); 
			//specify the folder for the imported files
			importF.parentFolder = inportFolder; 
		}
	}
	catch (error) {}
}

