// time from where the songs will start in sec
var startTime = currentFormatToTime(75, 25); 
// half transition time. needed to set the text.
var timeTransition = currentFormatToTime(10, 25); 
//take the time of the original song
var tempCompTime = findCompByName("Picture").duration;	
var summ = startTime + timeTransition*4;
var summ2 = startTime*2;
//create a loop by the number of lines in the CSV file. since we don't need line 0 - start the loop from 1.
for (var i = 1; i < textLines.length; i++){ 
	var random = getRandomInt (1,6);
	var text = textLines[i].split(";");
	if (text[0] != ""){
		// find the song "Picture"
		var tempComp = findCompByName("Picture"); 
		//duplicate the original composition
		var newComp = tempComp.duplicate();	
		//name it "Pic_1", "Pic_2", etc.
		newComp.name = "Pic_"+String(i);	
		//place the new song in the "infoline COMP" folder
		newComp.parentFolder = newFolder;	
		summ += tempCompTime - timeTransition*2;
		summ2 += tempCompTime - timeTransition*2;
		findCompByName("main").duration = summ2 + timeTransition*2;
		findCompByName("main").layer("End").startTime = summ + timeTransition*2 + startTime - currentFormatToTime(40,25);
    if (i==1) { 
		findCompByName("Pic_"+String(i)).layer(1).replaceSource(findImportFile (text[0]), true);
		findCompByName("Pic_"+String(i)).layer(2).replaceSource(findImportFile (text[0]), true);
		findCompByName("main").layer("Picture").replaceSource(findCompByName("Pic_"+String(i)), true);
		findCompByName("main").layer("Text_Up_"+String(i)).property("sourceText").setValue(text[1]);
		findCompByName("main").layer("Text_Down_"+String(i)).property("sourceText").setValue(text[2]);
		findEffectByName("Animation",findCompByName("main").layer("Pic_"+String(i))).property("ADBE Layer Control-0001").setValue(random);
	}
    else {
    	//change the picture in the composition "Pic_" to the number that is written in the CSV file in the 1st column.
        findCompByName("Pic_"+String(i)).layer(1).replaceSource(findImportFile (text[0]), true); 
        // the same thing, but with a second layer
		findCompByName("Pic_"+String(i)).layer(2).replaceSource(findImportFile (text[0]), true); 
		// duplicate the top text 
		var newTextUp = findCompByName("main").layer("Text_Up_"+String(i-1)).duplicate (); 
		// give it the name "Text_Up_" + number
		newTextUp.name = "Text_Up_"+String(i); 
		//does the same with the bottom text
		var newTextUp = findCompByName("main").layer("Text_Down_"+String(i-1)).duplicate (); 
		//assign it the name "Text_Down_" + number
		newTextUp.name = "Text_Down_"+String(i); 
		//move the bottom text under the top text
		findCompByName("main").layer("Text_Down_"+String(i)).moveAfter(findCompByName("main").layer("Text_Up_"+String(i))); 
		//insert data into the upper text from the CSV file 2 columns
		findCompByName("main").layer("Text_Up_"+String(i)).property("sourceText").setValue(text[1]); 
		//enter data in the lower text from the CSV file 3 columns
		findCompByName("main").layer("Text_Down_"+String(i)).property("sourceText").setValue(text[2]); 
		//set the start time for the top text
		findCompByName("main").layer("Text_Up_"+String(i)).startTime = summ - tempCompTime - timeTransition; 
		// the same for the bottom
		findCompByName("main").layer("Text_Down_"+String(i)).startTime = summ - tempCompTime - timeTransition; 
		// duplicate the layer with composition "Pic_" - 1
        var newLayer = findCompByName("main").layer("Pic_"+String(i-1)).duplicate (); 
        // Call it "Pic_" + number.
        newLayer.name = "Pic_"+String(i); 
        //duplicate layer with alpha channel "Alfa"-1
        var newAlfa = findCompByName("main").layer("Alfa"+String(i-1)).duplicate (); 
        //call it "Alfa "+number.
        newAlfa.name = "Alfa"+String(i); 
        //move the "Pic_" layer under the alpha channel layer
        findCompByName("main").layer("Pic_"+String(i)).moveAfter(findCompByName("main").layer("Alfa"+String(i))); 
        //replace the "Pic_"+number layer with a similar composition
        findCompByName("main").layer("Pic_"+String(i)).replaceSource(findCompByName("Pic_"+String(i)), true); 
        findEffectByName("Animation",findCompByName("main").layer("Pic_"+String(i))).property("ADBE Layer Control-0001").setValue(random);
        //set its blending mode to ALFA
        findCompByName("main").layer("Pic_"+String(i)).trackMatteType = TrackMatteType.ALPHA; 
        //set the start time for the "Alfa" layer
        findCompByName("main").layer("Alfa"+String(i)).startTime = summ - tempCompTime - timeTransition*2; 
        //set start time for layer "Pic_"+number
        findCompByName("main").layer("Pic_"+String(i)).startTime = summ - tempCompTime - timeTransition*2; 
        }
    }
    else break;
}
